from typing import List

def coin_change(coins: List[int], amount: int) -> int:
    dp = [amount+1]*(amount+1)
    dp[0] = 0
    for coin in coins:
        for i in range(coin,amount+1):
            dp[i] = min(dp[i-coin]+1,dp[i])
    return dp[amount] if dp[amount]!=(amount+1) else -1
